import React, { useState } from "react";
// import classNames from "classnames";
// import { Line, Bar } from "react-chartjs-2";
import axios from "axios";
import {
  Button,
  // ButtonGroup,
  Card,
  CardHeader,
  CardBody,
  // CardTitle,
  // DropdownToggle,
  // DropdownMenu,
  // DropdownItem,
  // UncontrolledDropdown,
  // Label,
  FormGroup,
  Form,
  Input,
  // Table,
  Row,
  Col,
  // UncontrolledTooltip,
  CardFooter,
} from "reactstrap";

// core components
// import {
//   chartExample1,
//   chartExample2,
//   chartExample3,
//   chartExample4,
// } from "variables/charts.js";

import bgImage from "assets/img/bg5.jpg";

function Register (props) {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState("");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [message, setMessage] = useState("");


  const handleRegister = async () => {
    // e.preventDefault();
  
    if (password !== confirmPassword) {
      setMessage("Password is not matched.");
      return;
    }

    try {
      console.log('Sending register request with:', { name, email, phone, username, password });
      const response = await axios.post('http://localhost:5000/register', {
        name,
        email,
        phone,
        username,
        password,
      }, {
        headers: {
          'Content-Type': 'application/json',
        },
      });
      console.log('Server response:', response.data);
    } catch (error) {
      if (error.response) {
        console.error('Error Response Data:', error.response.data);
        console.error('Error Status:', error.response.status);
        console.error('Error Headers:', error.response.headers);
      } else if (error.request) {
        console.error('No response received:', error.request);
      } else {
        console.error('Error Message:', error.message);
      }
    }

    setMessage("");
  };
  

  return (
    <div
      className="content d-flex justify-content-center align-items-center"
      style={{
        overflowX: "hidden",
        height: "100vh",
        backgroundImage: `url(${bgImage})`,
        backgroundSize: "cover",
        backgroundPosition: "center",
        backgroundRepeat: "no-repeat"
      }}
    >
      <Row>
        <Col md="6" className="text-center">
          <Card style={{ width: "400px" }}>
            <CardHeader>
              <h5>Create User</h5>
            </CardHeader>
            <CardBody>
              <Form>
                <Row className="justify-content-center">
                  <Col md="8">
                    <FormGroup>
                      <label>Full Name</label>
                      <Input
                        className="mt-1"
                        placeholder="Full Name"
                        value={name}
                        onChange={(e) => setName(e.target.value)}
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row className="justify-content-center">
                  <Col md="8">
                    <FormGroup>
                      <label>Email</label>
                      <Input
                        className="mt-1"
                        type="email"
                        placeholder="Email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row className="justify-content-center">
                  <Col md="8">
                    <FormGroup>
                      <label>Phone</label>
                      <Input
                        className="mt-1"
                        type="tel"
                        placeholder="Phone Number"
                        value={phone}
                        onChange={(e) => setPhone(e.target.value)}
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row className="justify-content-center">
                  <Col md="8">
                    <FormGroup>
                      <label>Username</label>
                      <Input
                        className="mt-1"
                        placeholder="Username"
                        value={username}
                        onChange={(e) => setUsername(e.target.value)}
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row className="justify-content-center">
                  <Col md="8">
                    <FormGroup>
                      <label>Password</label>
                      <Input
                        className="mt-1"
                        type="password"
                        placeholder="Password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row className="justify-content-center">
                  <Col md="8">
                    <FormGroup>
                      <label>Confirm Password</label>
                      <Input
                        className="mt-1"
                        type="password"
                        placeholder="Confirm Password"
                        value={confirmPassword}
                        onChange={(e) => setConfirmPassword(e.target.value)}
                      />
                    </FormGroup>
                  </Col>
                </Row>
              </Form>
              {message && <div>{message}</div>}
            </CardBody>
            <CardFooter>
              <Button type="submit" className="btn-fill" onClick={handleRegister} color="primary">
                Sign Up
              </Button>
              <br />
              <label>
                Already have an account? <a href="login">Login</a>
              </label>
            </CardFooter>
          </Card>
        </Col>
      </Row>
    </div>
  );
}  

export default Register;
